import React from "react";
import { Box, Grid, Typography } from "@mui/material";
import '../../css/Home/openinvestment.css'
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import { useEffect, useState } from "react";
import BG1 from '../../images/investments/image1.png';
import Logo1 from '../../images/investments/logo1.png';
import BG2 from '../../images/investments/image2.png';
import Logo2 from '../../images/investments/logo2.png';
import BG3 from '../../images/investments/image3.png';
import Logo3 from '../../images/investments/logo3.png';
import { makeStyles } from "@material-ui/core";
const data = [
    {
        id: 1, backgroundImage: BG1, logo:Logo1 , logoName: '', logoText: 'CCD', heading: 'MildCares - GynoCup', subHeading: 'This is not the actual text for this section of this card, something else will come here', description: 'We at Mildcares strive to empower womanhood! By building high-quality hygiene and personal care products our…',
        chip: [{ id: 1, name: 'health' }, { id: 2, name: 'Personal Health' }],
        raised: '14.16%',
        closesIn: '10 days',
        invest: '₹5,000',
    },
    {
        id: 1, backgroundImage: BG2, logo: Logo2, logoName: 'Settl', logoText: 'CSOP', heading: '', subHeading: 'This is not the actual text for this section', description: 'Settl. is a technology-driven accommodation platform focused on providing a convenient and high-quality living expe…',
        chip: [{ id: 1, name: 'health' }, { id: 2, name: 'Personal Health' }],
        raised: '',
        closesIn: '',
        invest: '',
    },
    {
        id: 1, backgroundImage: BG3, logo: Logo3, logoName: '', logoText: '', heading: '', subHeading: '', description: '',
        chip: [{ id: 1, name: 'health' }, { id: 2, name: 'Personal Health' }],
        raised: '',
        closesIn: '',
        invest: '',
    },
]


// const useStyles = makeStyles({
//   card: {
//     // maxWidth: 300,

//     backgroundColor: "red"
//   },
//   root:{
//     padding:'0 !important',
//   }
// });

export default function OpenInvestment() {
    const [gridxsFirst, setGridxsFirst] = useState(4)
    const [gridxsSecond, setgridxsSecond] = useState(6)
    const ratio = parseInt(window.innerWidth);
    // const classes = useStyles();

    useEffect(() => {

        if (ratio < 920) {
            setGridxsFirst(2)
            setgridxsSecond(12)
        }
        else if (ratio < 600) {
            setGridxsFirst(2)
            setgridxsSecond(6)
        }
    }, [])
    return (
        <>
            <Box sx={{ minHeight: '80vh', marginTop: '60px' }}>
                <Typography className="test-script-regular">Open<span className="test-script-bg"> Investment</span></Typography>
                <Typography style={{ fontSize: '18px', color: 'gray' }}>Text will be given by Arpit Subscribe to gain access to exclusive high return opportunities in growing business</Typography>
                <Grid sx={{ marginTop: '5px' }} container spacing={4}>
                    <Grid item xs={3}>
                        <Card sx={{ minWidth: '100%', padding: '0',paddingBottom:'0px !important' }} >
                            <CardContent sx={{ padding: '0' }}>
                                <div style={{ position: 'relative' }}>
                                    <img src={BG1} width={300} height={192} className="background-img-card" />
                                    <div className="card-header-logo">
                                        <div className="company-logo-section">
                                            <img src={Logo1} width={102} height={34} />
                                        </div>
                                        <div className="logo-txt-script">CCD</div>
                                    </div>
                                    <div className="info-card-txt">
                                        <span className="company-name">ams</span>
                                    </div>
                                    <div className="centered-txt-card">
                                        <span className="company-name">MildCares-GynoCup</span>
                                    </div>
                                    <div className="bottom-txt-card">
                                        <span>This is not the actual text for this section of this card,something else will come here</span>
                                    </div>
                                </div>
                                <div className="body-card-section">
                                    <span className="card-description">We at Mildcares strive to empower womanhood! By building high-quality hygiene and personal care products our…</span>
                                    <div className="chip-status">Health</div>
                                    <div className="footer-card-section">
                                        <div className="numbers-investors">
                                            <span className="percentage-investment">14.16%</span>
                                            <span className="investment-status">Raised</span>
                                        </div>
                                        <div className="vertical-line-invest"></div>
                                        <div className="numbers-investors">
                                            <span className="percentage-investment">14.16%</span>
                                            <span className="investment-status">Raised</span>
                                        </div>
                                        <div className="vertical-line-invest"></div>
                                        <div className="numbers-investors">
                                            <span className="percentage-investment">14.16%</span>
                                            <span className="investment-status">Raised</span>
                                        </div>
                                    </div>
                                </div>
                            </CardContent>
                        </Card>
                    </Grid>

                </Grid>
            </Box>
        </>
    )

}
